import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { AppBar, Toolbar, Typography, Container, CircularProgress, Button, Alert, Box } from '@mui/material';
import MatchList from './components/MatchList';
import './App.css';

// Backend API base URL - adjust if needed
const API_BASE_URL = 'http://localhost:8000';

function App() {
  const [matches, setMatches] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [connectionStatus, setConnectionStatus] = useState('Initializing...');
  const [lastUpdated, setLastUpdated] = useState(null);

  useEffect(() => {
    // Initial data load from REST API
    const fetchInitialData = async () => {
      try {
        console.log(`Fetching initial data from ${API_BASE_URL}/api/tennis`);
        setConnectionStatus(`Connecting to ${API_BASE_URL}...`);

        const response = await axios.get(`${API_BASE_URL}/api/tennis`, {
          timeout: 5000 // 5 second timeout
        });

        console.log('Received data:', response.data);

        if (response.data?.matches) {
          console.log(`Successfully loaded ${response.data.matches.length} matches`);
          setMatches(response.data.matches);
          setLastUpdated(new Date());
          setConnectionStatus('Connected via REST API');
        } else {
          console.error('No matches data in response:', response.data);
          setError('No match data available');
          setConnectionStatus('Connected, but no match data found');
        }
        setLoading(false);
      } catch (err) {
        console.error('Error fetching data:', err);
        setError(`API connection error: ${err.message}`);
        setConnectionStatus(`Connection failed: ${err.message}`);
        setLoading(false);
      }
    };

    // WebSocket connection for real-time updates
    const connectWebSocket = () => {
      const wsUrl = `ws://${window.location.hostname}:8000/ws`;
      console.log(`Connecting to WebSocket at ${wsUrl}`);

      const ws = new WebSocket(wsUrl);
      let reconnectTimer = null;

      ws.onopen = () => {
        console.log('WebSocket connected successfully');
        setConnectionStatus('WebSocket connected');
        setError(null); // Clear any previous errors on successful connection
      };

      ws.onmessage = (event) => {
        try {
          console.log('WebSocket message received');
          const data = JSON.parse(event.data);
          if (data?.matches) {
            console.log(`Received ${data.matches.length} matches via WebSocket`);
            setMatches(data.matches);
            setLastUpdated(new Date());
            setConnectionStatus('Data received via WebSocket');
          } else {
            console.error('Invalid data format received:', data);
          }
        } catch (err) {
          console.error('Error processing WebSocket message:', err);
        }
      };

      ws.onerror = (error) => {
        console.error('WebSocket error:', error);
        setConnectionStatus('WebSocket error - will retry');
      };

      ws.onclose = () => {
        console.log('WebSocket disconnected');
        setConnectionStatus('WebSocket disconnected - reconnecting...');
        // Try to reconnect after 5 seconds
        reconnectTimer = setTimeout(connectWebSocket, 5000);
      };

      return () => {
        if (reconnectTimer) {
          clearTimeout(reconnectTimer);
        }
        ws.close();
      };
    };

    fetchInitialData();
    const cleanup = connectWebSocket();
    return cleanup;
  }, []);

  // Function to manually refresh data
  const handleRefresh = async () => {
    setLoading(true);
    setError(null);

    try {
      const response = await axios.get(`${API_BASE_URL}/api/tennis`);
      if (response.data?.matches) {
        setMatches(response.data.matches);
        setLastUpdated(new Date());
        setConnectionStatus('Data refreshed');
      } else {
        setError('No matches data available');
      }
    } catch (err) {
      setError(`Failed to refresh: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Tennis Bot Dashboard
          </Typography>
          <Button color="inherit" onClick={handleRefresh} disabled={loading}>
            Refresh Data
          </Button>
        </Toolbar>
      </AppBar>

      <Container sx={{ mt: 3 }}>
        {/* Status information */}
        <Box mb={2}>
          <Alert severity={error ? "error" : "info"}>
            {connectionStatus}
            {lastUpdated && (
              <span> â€¢ Last updated: {lastUpdated.toLocaleTimeString()}</span>
            )}
          </Alert>
        </Box>

        {loading ? (
          <Box display="flex" flexDirection="column" alignItems="center" mt={5}>
            <CircularProgress />
            <Typography mt={2}>Loading tennis match data...</Typography>
          </Box>
        ) : error ? (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        ) : matches.length > 0 ? (
          <MatchList matches={matches} />
        ) : (
          <Alert severity="warning">
            No tennis matches available
          </Alert>
        )}
      </Container>
    </div>
  );
}

export default App;
